import React, { useState } from "react";
import { NavLink } from "react-router-dom";
import {
  Navigation,
  LogoFade,
  LinkBlack,
  LinkGray,
} from "../styles/navbar_style";

import Logo from "../images/Logo-Placeholder.png";
import {
  Collapse,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem,
  Button,
} from "reactstrap";

const Navibar = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggle = () => setIsOpen(!isOpen);

  return (
    <Navigation dark expand="sm">
      <NavbarBrand>
        <LogoFade>
          <img
            src={Logo}
            alt="logo"
            style={{ width: "100%", cursor: "pointer" }}
          />
        </LogoFade>
      </NavbarBrand>
      <NavbarToggler onClick={toggle} />
      <Collapse isOpen={isOpen} navbar>
        <Nav
          className="mr-auto"
          navbar
          style={{
            width: "100%",
            textAlign: "center",
            display: "flex",
            alignContent: "center",
          }}
        >
          <NavItem>
            <NavLink href="/meal-plans">Meal Plans</NavLink>
          </NavItem>
          <NavItem>
            <NavLink href="/catering">Catering</NavLink>
          </NavItem>
          <NavItem>
            <NavLink href="/build-a-meal">About Us</NavLink>
          </NavItem>
        </Nav>
      </Collapse>
    </Navigation>
  );
};

export default Navibar;
